syntax = "proto3";
option java_package = "com.huasheng.sa.quant.open.sdk.protobuf.hq.dto";
option java_outer_classname = "TimeShareProto";

message TimeShare {
  string time = 1; //时间字符串
  string price = 2; //当前价
  string preClose = 3; //昨收价
  string avgPrice = 4; //均价
  int64 volume = 5; //成交量
  double turnover = 6; //成交额
}